comprehensive = pd.read_csv('data/Human_ENSEMBL_Gene_ID_MSigDB.v7.0.chip', sep='\t')
comprehensive.drop_duplicates('Gene Symbol', keep='first', inplace=True)
geneToEnsemblIdDict = comprehensive.set_index('Gene Symbol')['Probe Set ID'].to_dict()

timeout = 1000
def lookup_gene(gene):
    try:
        url = f"http://rest.ensembl.org/lookup/symbol/homo_sapiens/{gene}?expand=1"
        response = requests.get(url, headers={"Content-Type": "application/json"}, timeout=timeout)
        if not response.ok:
            if gene not in geneToEnsemblIdDict:
                raise Exception('gene not found in ensemble')
            ensemblId = geneToEnsemblIdDict[gene]
            url = f"http://rest.ensembl.org/lookup/id/{ensemblId}?expand=1"
            response = requests.get(url, headers={"Content-Type": "application/json"}, timeout=timeout)
        if response.ok:
            d = response.json()
            ensemblId = d["id"]
            geneType = d["biotype"]
        else:
            raise Exception('response not ok')
        return gene, ensemblId, geneType
    except Exception as error:
        # handle the exception
        print(f'gene: {gene}, error: {error}')
        return gene, 'unidentified', 'unidentified'

